import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormBuilder, FormGroup } from '@angular/forms';

@Component({
  selector: 'app-morador',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './morador.component.html',
  styleUrls: ['./morador.component.css']
})
export default class MoradorComponent implements OnInit {

  formCadastroMorador: FormGroup;

  constructor(
    private fb: FormBuilder
  ){

  }

  ngOnInit(): void {

  }

  createFormCadastroMorador(){
    this.formCadastroMorador = this.fb.group({
      idMorador: '',
      nome: '',
      dataNascimento: '',
      rg: '',
      cpf: '',
      cep: '',
      endereco: '',
      tel: '',
      cel: ''
    });
  }

}
<div class="shadow-lg bg-white w-full h-full rounded-md py-4 px-6">
    <h5 class="mb-2">Morador</h5>
    <form class="grid grid-cols-8 gap-4">
        <div class="col-span-4">
            <label class="block tracking-wide text-gray-700 text-md font-semibold mb-2" for="grid-first-name">
              Nome
            </label>
            <input class="appearance-none block w-full bg-gray-200 text-gray-700 border border-red-500 rounded py-3 px-4 mb-3 leading-tight focus:outline-none focus:bg-white" id="grid-first-name" type="text" placeholder="Jane">
            <p class="text-red-500 text-xs italic">Campo obrigatório.</p>
        </div>
    </form>
</div>
